'''Trader Stan''' is the owner of the [[charter ship]]s that sail players to various places in ''[[RuneScape]]'' for a price, including [[Catherby]], [[Brimhaven]], [[Musa Point]], the [[ship yard]], [[Port Khazard]], [[Port Phasmatys]], [[Port Sarim]], and [[Port Tyras]]. Trader Stan himself can be found at the southern most dock of Port Sarim, wearing a mustard-yellow outfit.

He also sells a number of items in [[Trader Stan's Trading Post]], including common items like [[pot]]s, [[jug]]s, [[bowl]]s and [[tinderbox]]es, some [[food]] items including [[raw rabbit]] and [[banana]]s, and some [[fishing]] items such as [[fishing rod]]s and [[lobster pot]]s. He also sells more unusual items such as [[swamp paste]], [[eye patch]]es, [[glassblowing pipe]]s, [[bucket of sand]], [[seaweed]], [[soda ash]], and [[Tyras helm]]s.

